import React from 'react';

const Total = ({parts}) => {
    let totalExercises = 0;
    totalExercises = parts.reduce(part => Number(totalExercises += part.exercises))

    return (
        <p>Number of exercises {totalExercises}</p>
    )
  }

  export default Total;
